import { useEffect, useState } from "react";

function List(){
    const [images, setImages] = useState([]);

    useEffect(()=>{
        //load api data here
        fetch("https://jsonplaceholder.typicode.com/photos").then((res) => res.json()).then((res) => 
        {   
            console.log(res);
            setImages(res)});
    },[])

    return(
        <div>
            <h1>Image List Component</h1>
            <ul>
                {images[0].map((image,i)=>{
                   <li> <img src={image.thumbnailUrl} key={i} /> </li>
                })}
            </ul>
        </div>
    )

}

export default List;
